import CakeList from "./CakeLIst";
import Carousel from "./Carousel";
function Home() {
    const url = `${process.env.REACT_APP_CAKE_WEBSITE_API_URL}/allcakes`
    return (
        <div>
            <div className="row" style={{width:"100%", height:"75vh"}}>
                <Carousel/>
            </div>
            <div className="container">
                <div className="row">
                    <CakeList url={url}/>
                </div>
            </div>
        </div>
    );
}

export default Home;
